l_simp_chinese:
 br_france.1.t: "至暗岁月"
 br_france.1.desc: "大战结束以后，法国陷入了一场空前的混乱。政府失能、物价飞涨，大量精神失常的士兵被社会和家庭抛弃，几乎无法工作，而更多的正常人们，在被毒气、泥泞堑壕和隆隆炮火的洗礼中，一个接着一个地前往地狱，再也不会回来。一个普通的、仍然活着的男人，被一个个穿得花枝招展的女人们鄙夷着，一个普通的、也仍然活着的女人们，却为了生计奔走，和战争来临前一样，拿到的子不够一家人的温饱，甚至还要打个折扣。社会的怨气已经到了一种空前的地步。\n\n而为了改变这一现状，社会主义的、无政府主义的、实用主义的政治家们各自组织起自己的力量角逐权力，最终，[ROOT.GetLeader]携手人民阵线取得了胜利。\n\n法国在过去的几年里稍稍有了些恢复的迹象，然而政府的内部矛盾仍然遗毒"
 br_france.1.a: "愿上帝保佑您，[ROOT.GetLeader]。"

